		// splice alt forms
		for(let gen in arrays.Starter) {
			for(let p = arrays.Starter[gen].length-1; p >= 0; p--) {
				let base = arrays.Starter[gen][p];
				let mon = pokedex[base];
				if(!mon)
					continue;
				if(mon.fs)
					addToArray(base+"_female", "Starter", gen, false, {after:base});
				for(let f in mon.forms) {
					if(base == "PIKACHU" && mon.forms[f].kind != "gmax")
						continue;
					let sprite = base + "_" + f;
					if(arrays.Starter[gen].includes(sprite))
						continue;
					addToArray(sprite, "Starter", gen, mon.forms[f].fs, {after:base});
				}
			}
		}
